*/

// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;

import "@openzeppelin/contracts/token/ERC20/ERC20.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/security/Pausable.sol";
import "@openzeppelin/contracts/utils/Address.sol";

import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Factory.sol";
import "@uniswap/v2-core/contracts/interfaces/IUniswapV2Pair.sol";
import "@uniswap/v2-periphery/contracts/interfaces/IUniswapV2Router02.sol";

contract FRTCake is ERC20, Ownable, Pausable {
    // CONFIG START

    uint256 denominator = 100;
    
    // TOKEN
    string tokenName = "FairToken Cake";
    string tokenSymbol = "FRTC";
    uint256 tokenTotalSupply = 10_000_000_000 * (10**18);
    
    // ADRESSES
    address marketingWallet = 0xb51d78397646f53206C431c0313Bf84eA17FF426;
    address devWallet = 0xf0E2014Df61664C26400cbc4E38EE3482B2713D0;
    address router02 = 0x10ED43C718714eb63d5aA57B78B54704E256024E;

    // BUY TAX
    uint256 public devTaxBuy = 2;
    uint256 public marketingTaxBuy = 3;
    uint256 public redistributeTaxBuy = 12;

    // SELL TAX
    uint256 public devTaxSell = 2;
    uint256 public marketingTaxSell = 8;
    uint256 public redistributeTaxSell = 15;

    uint256 public maxTxAmount = 25_000_000 * 10**18 + 1;
    uint256 public maxWalletAmount = 25_000_000 * 10**18 + 1;

    // REDISTRIBUTION
    address public token = 0x0E09FaBB73Bd3Ade0a17ECC321fD13a19e81cE82;
    
    // CONFIG END
    
    IUniswapV2Router02 private _UniswapV2Router02;
    IUniswapV2Factory private _UniswapV2Factory;
    IUniswapV2Pair private _UniswapV2Pair;
    
    mapping (address => uint256) private nextBuyBlock;
    
    mapping (address => bool) public isExcluded;
    mapping (address => bool) public isExcludedFromBotProtection;

    // Whitelist
    bool public whitelistStatus;
    mapping (address => bool) public isWhitelisted;

    // Blacklist
    bool public blacklistStatus;
    mapping (address => bool) public isBlacklisted;
    
    uint256 private feeTokens;
    uint256 private marketingTokens;
    uint256 private devTokens;
    uint256 private redistributionTokens;

    bool public taxStatus;
    
    using Address for address;

    uint256 totalHolded;

    event LogNum(string, uint256);
    event LogBool(string, bool);
    event LogAddress(string, address);
    event LogString(string, string);
    event LogBytes(string, bytes);
    
    constructor() ERC20(tokenName, tokenSymbol) {
        _UniswapV2Router02 = IUniswapV2Router02(router02);
        _UniswapV2Factory = IUniswapV2Factory(_UniswapV2Router02.factory());
        _UniswapV2Pair = IUniswapV2Pair(_UniswapV2Factory.createPair(address(this), _UniswapV2Router02.WETH()));
        
        isExcluded[msg.sender] = true;
        isExcluded[marketingWallet] = true;
        isExcluded[address(this)] = true;

        isExcludedFromBotProtection[address(_UniswapV2Pair)] = true;

        taxStatus = true;
        
        _mint(msg.sender, tokenTotalSupply);
    }

    bool inTax;
    
    function handleFees(address sender, address recipient, uint256 amount) internal returns (uint256 fee) {
        bool isBuy = sender == address(_UniswapV2Pair);
        bool isSell = recipient == address(_UniswapV2Pair);

        uint256 fees;
        uint256 taxSum;

        uint256 devAmount;
        uint256 marketingAmount;
        uint256 redistributionAmount;

        if(isBuy) {
            fees = amount * 10**18 / denominator * (devTaxBuy + marketingTaxBuy + redistributeTaxBuy) / 10**18;

            taxSum = devTaxBuy + marketingTaxBuy + redistributeTaxBuy;

            devAmount = fees * 10**18 / taxSum * devTaxBuy / 10**18;
            marketingAmount = fees * 10**18 / taxSum * marketingTaxBuy / 10**18;
            redistributionAmount = fees * 10**18 / taxSum * redistributeTaxBuy / 10**18;

            feeTokens += fees;

            marketingTokens += marketingAmount;
            devTokens += devAmount;
            redistributionTokens += redistributionAmount;

            super._transfer(sender, address(this), fees);
        } else if(isSell) {
            fees = amount * 10**18 / denominator * (devTaxSell + marketingTaxSell + redistributeTaxSell) / 10**18;

            taxSum = devTaxSell + marketingTaxSell + redistributeTaxSell;
            
            devAmount = fees * 10**18 / taxSum * devTaxSell / 10**18;
            marketingAmount = fees * 10**18 / taxSum * marketingTaxSell / 10**18;
            redistributionAmount = fees * 10**18 / taxSum * redistributeTaxSell / 10**18;

            feeTokens += fees;

            marketingTokens += marketingAmount;
            devTokens += devAmount;
            redistributionTokens += redistributionAmount;

            super._transfer(sender, address(this), fees);

            if(feeTokens > 0) {
                address[] memory path = new address[](2);
                path[0] = address(this);
                path[1] = _UniswapV2Router02.WETH();
                
                uint256 startBalance = address(this).balance;
                
                _approve(address(this), address(_UniswapV2Router02), feeTokens);

                inTax = true;
                
                _UniswapV2Router02.swapExactTokensForETH(
                    feeTokens,
                    0,
                    path,
                    address(this),
                    block.timestamp
                );
                
                uint256 ethGained = address(this).balance - startBalance;
                
                Address.sendValue(payable(marketingWallet), marketingTokens * 10**18 / feeTokens * ethGained / 10**18);
                Address.sendValue(payable(devWallet), devTokens * 10**18 / feeTokens * ethGained / 10**18);

                address[] memory currentPath = new address[](2);
                currentPath[0] = _UniswapV2Router02.WETH();
                currentPath[1] = token;

                if(redistributionTokens > 0) {
                    _UniswapV2Router02.swapExactETHForTokens{value: redistributionTokens * 10**18 / feeTokens * ethGained / 10**18}(
                        0,
                        currentPath,
                        address(this),
                        block.timestamp
                    );
                }

                inTax = false;

                feeTokens = 0;
                marketingTokens = 0;
                devTokens = 0;
                redistributionTokens = 0;
            }
        }

        return fees;
    }
    
    function _transfer(address sender, address recipient, uint256 amount) internal override virtual {
        if(isExcluded[msg.sender] || isExcluded[tx.origin] || inTax) {
            super._transfer(sender, recipient, amount);
        } else {
            if(!isExcluded[sender] && !isExcluded[recipient]) {
                require(!paused(), "FRTC: Transfers paused");
                require(!blacklistStatus || (!isBlacklisted[sender] && !isBlacklisted[recipient]), "FRTC: Blacklisted");
                require(!whitelistStatus || (isWhitelisted[sender] && isWhitelisted[recipient]), "FRTC: Not Whitelisted");

                if(sender == address(_UniswapV2Pair) || recipient == address(_UniswapV2Pair)) {
                    if(sender == address(_UniswapV2Pair)) {
                        require(amount <= maxTxAmount, "FRTC: Max tx amount");
                        require(sender != address(_UniswapV2Pair) || (sender == address(_UniswapV2Pair) && block.number >= nextBuyBlock[recipient]), "FRTC: Cooldown");

                        nextBuyBlock[recipient] = block.number + 1;
                    }

                    if(taxStatus) {
                        uint256 fees = handleFees(sender, recipient, amount);
                        amount -= fees;   
                    }

                    require(isExcludedFromBotProtection[recipient] || balanceOf(recipient) + amount <= maxWalletAmount, "FRTC: Max wallet amount");                
                }
            }

            if(sender == address(_UniswapV2Pair) && !isExcludedFromBotProtection[recipient]) {
                require(!recipient.isContract(), "FRTC: Bot Protection");
            } else if(recipient == address(_UniswapV2Pair) && !isExcludedFromBotProtection[sender]) {
                require(!sender.isContract(), "FRTC: Bot Protection");
            }

            super._transfer(sender, recipient, amount);
        }
    }

    /**
     * General settings
     */

    function setToken(address newValue) external onlyOwner {
        require(newValue != token, "FRTC: Value already set to that option");

        token = newValue;
    }

    function setDenominator(uint256 newValue) external onlyOwner {
        require(newValue != denominator, "FRTC: Value already set to that option");

        denominator = newValue;
    }

    function setMaxTxAmount(uint256 newValue) external onlyOwner {
        require(newValue != maxTxAmount, "FRTC: Value already set to that option");

        maxTxAmount = newValue;
    }

    function setMaxWalletAmount(uint256 newValue) external onlyOwner {
        require(newValue != maxWalletAmount, "FRTC: Value already set to that option");

        maxWalletAmount = newValue;
    }



    /**
     * Exclude
     */

    function setExcluded(address account, bool newValue) external onlyOwner {
        require(newValue != isExcluded[account], "FRTC: Value already set to that option");

        isExcluded[account] = newValue;
    }

    function setExcludedFromBotProtection(address account, bool newValue) external onlyOwner {
        require(newValue != isExcludedFromBotProtection[account], "FRTC: Value already set to that option");

        isExcludedFromBotProtection[account] = newValue;
    }

    function massSetExcluded(address[] memory accounts, bool newValue) external onlyOwner {
        for(uint256 i; i < accounts.length; i++) {
            require(newValue != isExcluded[accounts[i]], "FRTC: Value already set to that option");

            isExcluded[accounts[i]] = newValue;
        }
    }

    function massSetExcludedFromBotProtection(address[] memory accounts, bool newValue) external onlyOwner {
        for(uint256 i; i < accounts.length; i++) {
            require(newValue != isExcludedFromBotProtection[accounts[i]], "FRTC: Value already set to that option");

            isExcludedFromBotProtection[accounts[i]] = newValue;
        }
    }



    /**
     * Blacklist & whitelist
     */

    function setBlacklistStatus(bool newValue) external onlyOwner {
        require(blacklistStatus != newValue, "FRTC: Value already set to that option");

        blacklistStatus = newValue;
    }

    function setWhitelistStatus(bool newValue) external onlyOwner {
        require(whitelistStatus != newValue, "FRTC: Value already set to that option");

        whitelistStatus = newValue;
    }

    function setBlacklisted(address account, bool newValue) external onlyOwner {
        require(newValue != isBlacklisted[account], "FRTC: Value already set to that option");

        isBlacklisted[account] = newValue;
    }

    function setWhitelisted(address account, bool newValue) external onlyOwner {
        require(newValue != isWhitelisted[account], "FRTC: Value already set to that option");

        isWhitelisted[account] = newValue;
    }

    function massSetBlacklisted(address[] memory accounts, bool newValue) external onlyOwner {
        for(uint256 i; i < accounts.length; i++) {
            require(newValue != isBlacklisted[accounts[i]], "FRTC: Value already set to that option");

            isBlacklisted[accounts[i]] = newValue;
        }
    }

    function massSetWhitelisted(address[] memory accounts, bool newValue) external onlyOwner {
        for(uint256 i; i < accounts.length; i++) {
            require(newValue != isWhitelisted[accounts[i]], "FRTC: Value already set to that option");

            isWhitelisted[accounts[i]] = newValue;
        }
    }



    /**
     * Taxes
     */

    function setTaxesBuy(uint256 dev, uint256 marketing, uint256 redistribution) external onlyOwner {
        devTaxBuy = dev;
        marketingTaxBuy = marketing;
        redistributeTaxBuy = redistribution;
    }

    function setTaxesSell(uint256 dev, uint256 marketing, uint256 redistribution) external onlyOwner {
        devTaxSell = dev;
        marketingTaxSell = marketing;
        redistributeTaxSell = redistribution;
    }

    function setTaxStatus(bool newValue) external onlyOwner {
        require(taxStatus != newValue, "FRTC: Value already set to that option");

        taxStatus = newValue;
    }

    function withdrawETH(address to, uint256 value) external onlyOwner {
        require(address(this).balance >= value, "FRTC: Insufficient ETH balance");

        (bool success,) = to.call{value: value}("");
        require(success, "FRTC: Transfer failed");
    }

    function withdrawTokens(address tokenAddress, address to, uint256 value) external onlyOwner {
        require(IERC20(tokenAddress).balanceOf(address(this)) >= value, "FRTC: Insufficient token balance");

        try IERC20(token).transfer(to, value) {} catch {
            revert("FRTC: Transfer failed");
        }
    }
    
    receive() external payable {}
}"
